INSERT INTO `performer` VALUES ('12fd7452-7583-4c41','Travis Scott',1,1,'Jacques Bermon Webster II (born April 30, 1991), known professionally as Travis Scott is an American rapper, singer, songwriter, and record producer.','Active'),('d560df1f-345a-4415','Queen',4,4,'Queen are a British rock band formed in London in 1970 by Freddie Mercury (lead vocals, piano), Brian May (guitar, vocals), and Roger Taylor (drums, vocals), later joined by John Deacon (bass). Their earliest works were influenced by progressive rock, hard rock, and heavy metal, but the band gradually ventured into more conventional and radio-friendly works by incorporating further styles, such as arena rock and pop rock.','Active'),('f0197dbe-66a7-41e3','Post Malone',8,1,'Austin Richard Post (born July 4, 1995), known professionally as Post Malone, is an American rapper, singer, songwriter, record producer, and actor. Malone has gained distinction and acclaim for his blending of various genres including hip hop, pop, R&B, and trap.','Active'),('pf001','Dilaw',1,1,'A Filipino rock band formed in Baguio, Benguet. YES SIR','Inactive'),('pf002','Ben and Ben',2,4,'Award-winning nine piece folk-pop band in Manila.','Active'),('pf003','Kamikaze',3,4,'Filipino rock band formed in 2000.','Active'),('pf004','The Animals',4,4,'British rock-band from Great Britain that started in 1963.','Active'),('pf005','Ed Sheeran',2,1,'Grammy-winning English singer-songwriter.','Active'),('pf006','Hev Abi',4,1,'Rising star in hip hop and alternative hip hop genres.','Active'),('pf007','Rob Deniel',2,1,'Filipino singer-songwriter under Viva Records.','Active'),('pf008','NIKI',1,1,'Indonesian singer-songwriter based in Los Angeles.','Active'),('pf009','Jason Dhakal',1,1,'Contemporary queer R&B singer-songwriter.','Active'),('pf010','Lola Amour',2,4,'Filipino rock band formed in Muntinlupa, Metro Manila, Philippines in 2013.','Active');
